package solution242

import (
	"fmt"
	"testing"
)

var testCases = []struct {
	InputA string
	InputB string
	Output bool
}{
	// Mandatory Test Cases
	{
		InputA: "anagram",
		InputB: "nagaram",
		Output: true,
	},
	{
		InputA: "rat",
		InputB: "car",
		Output: false,
	},
	// Additional my custom cases
	{
		InputA: "aa",
		InputB: "bb",
		Output: false,
	},
	{
		InputA: "xaaddy",
		InputB: "xbbccy",
		Output: false,
	},
	{
		InputA: "",
		InputB: "",
		Output: true,
	},
}

func Test_isAnagram(t *testing.T) {
	for _, tc := range testCases {
		var label string
		if len(tc.InputA) > 20 {
			label = fmt.Sprintf("Case: Input: %v... and %v..., Output: %v\n", tc.InputA[:10], tc.InputB[:10], tc.Output)
		} else {
			label = fmt.Sprintf("Case: Input: %v and %v Output: %v\n", tc.InputA, tc.InputB, tc.Output)
		}
		t.Run(label, func(t *testing.T) {
			output := isAnagram(tc.InputA, tc.InputB)
			if output != tc.Output {
				t.Errorf("Expected output to be %v but we got %v", tc.Output, output)
			}
		})
	}
}

func Benchmark_isAnagram(b *testing.B) {
	for i := 0; i < b.N; i++ {
		_ = isAnagram(testCases[0].InputA, testCases[0].InputB)
	}
}
